import React, { Component } from 'react';
import data from '../data';

console.log(data)

class Part1 extends Component {
    constructor () {
        super();

        this.state = {
            index: 0
        }
    }

    prevButton() {
        if (this.state.index === 0) {
        } return 
        this.setState({ index: this.state.index - 1})
    }

    render() {
        return (
            <div>
                <h2>{data[this.state.index].name.first}</h2>
                <button onClick={(e) => this.prevButton() }> Previous </button>
                <button onClick={(e) => this.setState({ index: this.state.index + 1}) }> Next </button>
            </div>
        )
    }
}

export default Part1
